import React, { Component } from 'react';
import { Rnd } from 'react-rnd';
import Left from '../components/left';
import ChatMain from '../components/chat-main';

export default function Main() {
  return (
    <>
      <Rnd
        default={{
          x: 200,
          y: 50,
          width: 400,
          height: 640,
        }}
        minWidth={200}
        minHeight={400}
        bounds="window"
      >
        <div className="box">
          <div className="left">
            <Left />
          </div>
          <div className="main-chat">
            <ChatMain />
          </div>
        </div>
      </Rnd>
    </>
  );
}
